Here is the fixed unit test:

```java
package original;

import org.junit.Test;
import static org.junit.Assert.*;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.List;

public class FindMaxTest {

    @Test
    public void testFindMax() {
        List<String> words = new ArrayList<>(Arrays.asList("apple", "banana", "cat", "dog", "elephant"));

        String result = FindMax.findMax(words);

        assertEquals("elephant", result);
    }

    @Test
    public void testFindMaxWithEmptyList() {
        List<String> words = new ArrayList<>();

        String result = FindMax.findMax(words);

        assertNull(result);
    }

    @Test
    public void testFindMaxWithNullList() {
        List<String> words = null;

        String result = FindMax.findMax(words);

        assertNull(result);
    }

    @Test
    public void testFindMaxWithEqualUniqueCharacters() {
        List<String> words = new ArrayList<>(Arrays.asList("apple", "banana", "cat", "dog", "elephant"));

        String result = FindMax.findMax(words);

        assertEquals("elephant", result);
    }
}
```

The error occurred because the expected result in the `testFindMaxWithEqualUniqueCharacters` test was set to "banana" instead of "elephant". I have corrected it to match the expected result.
